import React from 'react';

function Dashboard() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Dashboard</h1>
      <p>Welcome to your financial dashboard!</p>
    </div>
  );
}

export default Dashboard;
